function OptionsController(){Controller.call(this),this.swapTabs(),this.loadCheckItems(),this.loadSupportStores()}OptionsController.prototype.swapTabs=function(){require([this.utilStaticPrefix+"/jquery.tabs.min.js"],function(){$(".tabs").tabs({eventType:"click",effect:"slideDown",duration:200})})},OptionsController.prototype.loadCheckItems=function(){require([this.appStaticPrefix+"/product/items.min.js"],function(){$("#checkItems").load($("#checkItems").attr("data-source"),function(){new CheckItems({scope:this})})})},OptionsController.prototype.loadSupportStores=function(){require([this.appStaticPrefix+"/product/supportStore.min.js"],function(){$("#supportStore").load($("#supportStore").attr("data-source"),function(){new SupportStore({scope:this})})})},$(document).ready(function(){new OptionsController});